    public void testEqualsShouldReturnTrueForSameObject() {
        // Given:
        final Object[] params = new Object[] { 1, 1.0 };

        DataProviderFrameworkMethod m = new DataProviderFrameworkMethod(method, 70, params, "%p[70]");

        // When:
        boolean result = m.equals(m);

